INSERT INTO `addons` (`id`, `name`, `composerVendor`, `composerName`, `userId`, `repository`, `repositoryHosting`, `shortDescription`, `description`, `descriptionFormat`, `demo`, `updatedAt`, `defaultLicense`, `totalDownloadsCount`, `totalInstallsCount`, `deletedAt`, `deletedBy`) VALUES
(1,	'RatingControl',	'redhead',	'rating-control',	1,	'',	NULL,	'Jednoduchá třída na vykreslení „hvězdičkového“ hodnocení',	'Ukázka\r\n------\r\n[* http://files.nette.org/1417/rating-control.png *] *** Ukázka Rating Control v příkladu z downloadu.\r\n\r\n\r\nInstalace\r\n---------\r\n\r\nStáhněte si komprimovanou složku z této stránky a rozbalte ji. Složka Example je funkční řešení v Nette aplikaci (RatingModel není připojen k databázi - vrací pevná data). Složka RatingControl obsahuje samotnou komponentu + JavaScriptový soubor pro jQuery (přechod myší přes hvězdičky). Komponentu umístěte do vhodné složky ve vašem projektu (např. controls)\r\n\r\n\r\nPoužití\r\n---------\r\n\r\nRatingControl funguje na principu jediné instance třídy RatingControl. Více hodnocení na stránce je řešeno pomocí metody render, které se předává jedinečné ID (např. ID produktu, článku, atd.) nebo samotný objekt (např. instance třídy Product, Article, atd.). O získání dat a vložení hodnocení se stará interface IRatingModel, který je nutno implementovat (všechny metody IRatingModel jsou popsány v souboru IRatingModel.php; popřípadě se lze inspirovat příkladem RatingModel.php ve složce Example). Instanci Rating modelu je pak nutné předat instanci RatingControl metodou setRatingModel().\r\n\r\nPoužití v aplikaci se pak rovná vytvoření komponenty přes továrničku a v šabloně nechat vykreslit hodnocení pro dané ID/objekt:\r\n\r\n/--php\r\nprotected function createComponentRating($name) {\r\n	$rating = new RatingControl($this, $name);\r\n	$rating->setRatingModel(new RatingModel);\r\n}\r\n\\--\r\n/--html\r\n{foreach $products as $product}\r\n	<h3>{$product->title}</h3>\r\n	{widget rating $product}\r\n	{* nebo *}\r\n	{widget rating $product->id}\r\n{/foreach}\r\n\\--\r\n\r\n\r\nAjax\r\n---------\r\n\r\nRatingControl podporuje ajaxové vložení nového hodnocení na základě skriptu jquery.nette.js (viz Doplňky), kde pro každý odkaz s CSS třídou \'ajax\' je url odkazu volána ajaxově.\r\n',	'texy',	NULL,	'2012-09-24 23:29:18',	'BSD-3-Clause',	594,	570,	NULL,	NULL),
(2,	'TwitterControl',	'smasty',	'twitter-control',	1,	'https://github.com/smasty/TwitterControl',	'github',	'Nette Framework Control for rendering tweets.',	'Vlastnosti\r\n==========\r\n[* http://files.nette.org/2630/47-3046x1050.png 250x353 >]\r\n- Jednoduché [použitie|#pouzitie]\r\n- Vysoká konfigurovateľnosť\r\n- Tri preddefinované render štýly\r\n- Pekne naformátované retweets a replies\r\n- Možnosť zobraziť/skryť hlavičku s informáciami o autorovi\r\n- Možnosť zobraziť/skryť avatary vedľa tweetu\r\n- Podporuje Twitter \"Web Intents\":https://dev.twitter.com/docs/intents - Akcie reply, retweet, favorite priamo v tweete (možnosť povoliť/zakázať)\r\n- Zobrazuje čas v slovnom formáte zhodnom s Twitterom (založené na [timeAgoInWords|helper-time-ago-in-words])\r\n- Podpora pre \"Tweet Entites\":https://dev.twitter.com/docs/tweet-entities\r\n- Podpora pre **Media Entities** - obrázky z tweetov sa zobrazia formou \"//lightboxu//\".\r\n- Možnosť zmeniť šablónu, spôsob načítavania tweetov a aj spôsob ich formátovania (rozhrania `IFormatter` a `ILoader`).\r\n- Základná šablóna splňuje Twitter \"Design Guidelines\":https://dev.twitter.com/terms/display-guidelines\r\n- Nevyžaduje prítomnosť rozšírenia **curl** a od verzie 2.0 ani prítomnosť **mbstring**.\r\n- Nevyžaduje Twitter API key, ale nepodporuje profily s //protected tweets//.\r\n\r\n\r\nInštalácia\r\n==========\r\n\r\nPreferovaný spôsob inštalácie je použitie [Composeru|doc:composer]. Stačí do vášho súboru `composer.json` pridať nasledovnú závislosť:\r\n\r\n/--js\r\n{\r\n    \"require\": {\r\n        \"smasty/TwitterControl\": \"dev-master\"\r\n    }\r\n}\r\n\\--\r\n\r\n\r\nPoužitie\r\n========\r\nDo šablóny treba pripojiť súbor `TwitterControl.css` spolu so //sprite// obrázkom z adresára `client-side`, taktiež aj súbor `TwitterControl.js` (vyžaduje jQuery).\r\n\r\nTovárnička v presenteri:\r\n\r\n/--php\r\nprotected function createComponentTwitterFeed($name){\r\n	return new Smasty\\Components\\Twitter\\Control(array(\r\n		\'screenName\' => \'TesterJohnny\',\r\n		\'tweetCount\' => 5\r\n	));\r\n}\r\n\\--\r\n\r\nMôžeme nadefinovať aj ďalšie možnosti zobrazenia (viď. [možnosti nastavnia|#konfiguracia]).\r\n\r\nV šablóne môžeme zvoliť jedno z troch predvolených zobrazení:\r\n\r\n/--html\r\n{control twitterFeed:full}\r\n\r\n{control twitterFeed:medium}\r\n\r\n{control twitterFeed:minimal}\r\n\\--\r\n\r\nPomocou parametra render metód môžeme zobrazenie ďalej pozmeniť:\r\n\r\n/--html\r\n{control twitterFeed:minimal, tweetCount => 7, retweets => false}\r\n\\--\r\n\r\nMôžeme tiež použiť kompletne vlastné zobrazenie, stačí použiť základnú render metódu a konfiguráciu uviesť až v šablóne, alebo naopak hneď v konštruktore komponenty:\r\n\r\n/--html\r\n{control twitterFeed, retweets => false, replies => true, intents => false}\r\n\\--\r\n\r\nSúbor so šablónou môžete zmeniť pomocou metódy `setTemplateFile()`, ktorá používa fluent interface a vracia inštanciu komponenty.\r\n\r\nKonfigurácia\r\n============\r\n\r\nTwitterControl podporuje široké množstvo nastavení, ktoré je možné konfigurovať v štyroch úrovniach:\r\n1. Použitím východzích hodnotôt\r\n2. Konfigurácia v konštruktore komponenty\r\n3. Použitím niektorej z troch pripravených render metód\r\n4. Priamo v šablóne pomocou parametrov makra `{control}`.\r\n\r\nV tomto poradí je aj priorita možností, čo teda definujete v šablóne, prepíše hodnoty definované render metódou, tá zase prepíše hodnoty definované v konštruktore, ktorý prepíše východzie hodnoty //(trochu komplikovaná veta...)//\r\n\r\nKonfigurácia sa vždy udáva vo forme asociatívneho poľa, výnimkou je len konštruktor, kde je možné uviesť screenName z Twitteru (ako `string`) alebo číselné ID používateľa.\r\n\r\nDostupné parametre\r\n------------------\r\n| Parameter 	| Typ 		| Predvolená hodnota	| Popis\r\n|----------------------------------------------------------------\r\n| `screenName`	| `string`	| `null` 		| Twitter meno používateľa *\r\n| `userId` 	| `int`		| `null` 		| Číselné ID používateľa *\r\n| `tweetCount`	| `int`		| `5` 			| Počet zobrazených tweetov\r\n| `header`	| `bool`	| `true`		| Zobraziť hlavičku s užívateľskými informáciami\r\n| `avatars`	| `bool`	| `true`		| Zobraziť avatary vedľa tweetov\r\n| `retweets`	| `bool`	| `true`		| Zobraziť retweety\r\n| `replies`	| `bool`	| `true`		| Zobraziť tweety, ktoré sú replies\r\n| `intents`	| `bool`	| `true`		| Zobraziť Tweet Intents (akcie Reply, Retweet, Favorite)\r\n\r\n\\* **Povinné** je definovať buď `screenName` alebo `userId`. Ak sú definované obe, použije sa len `userId`.\r\n\r\n\r\nRozšíriteľnosť\r\n==============\r\n\r\nOd verzie 2.0 TwitterControl podporuje možnosť použitia vlastnej triedy zodpovednej za načítavanie tweetov.\r\nTaktiež je možné zmeniť aj triedu zodpovednú za formátovanie tweetov.\r\nSlúžia na to rozhrania `Smasty\\Components\\Twitter\\ILoader` a `IFormatter`.\r\n\r\n/--php\r\nprotected function createComponentTwitterFeed($name){\r\n	$control = new Smasty\\Components\\Twitter\\Control(array(...));\r\n\r\n	// použijeme vlastný loader\r\n	$control->setLoader(new My\\Super\\OAuthLoader($authKey));\r\n\r\n	// zmeníme formátovanie tweetov\r\n	$control->setFormatter(new My\\Super\\TweetFormatter());\r\n\r\n	return $control;\r\n}\r\n\\--\r\n\r\n\r\nPlány do budúcnosti\r\n===================\r\n- Možnosť prekladu komponenty pripojením translatoru ako vo formulároch (`$twitterControl->setTranslator()`).\r\n- Pokročilé cachovanie tweetov.\r\n',	'texy',	'http://smasty.github.com/TwitterControl/',	'2012-09-25 00:36:50',	'MIT',	951,	883,	NULL,	NULL),
(3,	'VisualPaginator',	'dg',	'visual-paginator',	7,	'',	NULL,	'Jednoduchý vizuální stránkovač.',	'Ukázka\r\n------\r\n\r\n[* http://files.nette.org/171/paginator.png *]\r\n\r\n\r\nPoužití\r\n-------\r\n\r\nKomponentu stránkovače vytvoříme a připojíme k presenteru, například po názvem `vp`:\r\n\r\n/--php\r\n	public function renderDefault()\r\n	{\r\n		// create visual paginator control\r\n		$vp = new VisualPaginator($this, \'vp\');\r\n		...\r\n\\--\r\n\r\nStránkovač si sám pamatuje aktuální číslo stránky, stačí tedy nastavit počet prvků na stránku a celkový počet prvků. Pro usnadnění jeho metoda getPaginator() vrací objekt [Nette\\Paginator | doc:pagination].\r\n\r\n/--php\r\n		...\r\n		$paginator = $vp->getPaginator();\r\n		$paginator->itemsPerPage = 15;\r\n		$paginator->itemCount = count($items);\r\n		...\r\n		//příklad jak omezit třeba výběr řádků ze SQL pro danou stránku (s dibi)\r\n		$rows = dibi::fetchAll(\'SELECT ... ORDER BY ... %ofs %lmt\', $paginator->offset, $paginator->itemsPerPage);\r\n\\--\r\n\r\nA nakonec jej můžeme vykreslit v šabloně pomocí makra `widget`:\r\n\r\n/--code html\r\n{control vp}\r\n\\--\r\n',	'texy',	NULL,	'2012-09-25 00:38:39',	'BSD-3-Clause',	322,	361,	NULL,	NULL),
(4,	'Gridito',	'jan-marek',	'gridito',	4,	'https://github.com/janmarek/Gridito',	'github',	'Datagrid for Nette Framework',	'...',	'texy',	NULL,	'2012-09-25 00:41:43',	'MIT',	182,	195,	NULL,	NULL),
(5,	'NiftyGrid',	'nifty',	'nifty-grid',	5,	'https://github.com/Niftyx/NiftyGrid',	'github',	'DataGrid for Nette Framework',	'Závislosti\r\n==========\r\n-jQuery\r\n-JQuery UI - Datepicker a Autocomplete\r\n\r\nPodpora databázových knihoven\r\n==========\r\n|----------------\r\n|Knihovna | Namespace | Autor\r\n|----------------\r\n|Nette\\Database, NotORM | NiftyGrid\\NDataSource  | Nifty\r\n|Doctrine | NiftyGrid\\DoctrineDataSource | echo\r\n|DibiFluent | NiftyGrid\\DibiFluentDataSource | Milo\r\n\r\nZákladní použití\r\n==========\r\nStažený NiftyGrid přesuneme do svého projektu. Vlastní Grid vytvoříme v samostatné třídě (znovupoužitelnost, přehlednost). Každý Grid dědí od základního Gridu \\NiftyGrid\\Grid.\r\n\r\n.[caution]\r\nPro zjednodušení budeme vybírat data přímo z databáze bez modelů. Ve vlastní aplikaci byste použili své modely. Níže uvedené příklady jsou psané pro Nette\\Database.\r\n\r\nPro příklady budeme používat následující databázi:\r\n[* http://files.nette.org/2872/niftygrid-schema.png *]\r\n\r\n1. V presenteru si vytvoříme továrničku na svůj Grid a do konstruktoru předáme tabulku.\r\n/--php\r\nprotected function createComponentArticleGrid()\r\n{\r\n	return new ArticleGrid($this->context->database->table(\'article\'));\r\n}\r\n\\--\r\n\r\n2. Vytvoříme si třídu s vlastním Gridem. V metodě configure se odehrává veškeré nastavení Gridu. Jako jediný parametr má Presenter, který obdrží automaticky od metody [api:Nette\\Application\\UI\\PresenterComponent::attached()].\r\n/--php\r\nuse \\NiftyGrid\\Grid;\r\n\r\nclass ArticleGrid extends Grid{\r\n\r\n	protected $articles;\r\n\r\n	public function __construct($articles)\r\n	{\r\n		parent::__construct();\r\n		$this->articles = $articles;\r\n	}\r\n\r\n	protected function configure($presenter)\r\n	{\r\n		//Vytvoříme si zdroj dat pro Grid\r\n		//Při výběru dat vždy vybereme id\r\n		$source = new \\NiftyGrid\\NDataSource($this->articles->select(\'article.id, title, status, published, category.name AS category_name, user.username, user.id AS user_id\'));\r\n		//Předáme zdroj\r\n		$this->setDataSource($source);\r\n	}\r\n}\r\n\\--\r\n\r\n3. Nyní už v metodě configure můžeme vytvářet sloupce. Každý název sloupce se musí jmenovat podle názvu sloupce v tabulce (případně aliasu).\r\n\r\n/--php\r\n$this->addColumn(\'title\', \'Titulek\', \'250px\', 30);\r\n$this->addColumn(\'username\', \'Autor\', \'100px\');\r\n$this->addColumn(\'published\', \'Datum\', \'100px\');\r\n$this->addColumn(\'status\', \'Status\', \'100px\');\r\n$this->addColumn(\'views\', \'Zobrazení\', \'100px\');\r\n\\--\r\nPrvní parametr a zároveň jediný povinný je název sloupce. Druhý parametr, label, je záhlaví sloupce. Třetí parametr je šířka sloupce - může být v pixelech i procentech. Poslední parametr je oříznutí textu.\r\n\r\nUkázka [zde | www.grid.jakubholub.cz/basicgrid]\r\n\r\nVlastní nastavení\r\n/--php\r\n//pro vypnutí stránkování a zobrazení všech záznamů\r\n$this->paginate = FALSE;\r\n//zruší řazení všech sloupců\r\n$this->enableSorting = FALSE;\r\n//nastavení šířky celého gridu\r\n$this->setWidth(\'1000px\');\r\n//defaultní řazení\r\n$this->setDefaultOrder(\"article.id DESC\");\r\n//počet záznamů v rozbalovacím seznamu\r\n$this->setPerPageValues(array(10, 20, 50, 100));\r\n//vypnutí řazení na konkrétní sloupec\r\n$this->addColumn(\'column\', \'Column\')\r\n	->setSortable(FALSE);\r\n\\--\r\nFormátování výsledku\r\n=============\r\nVýsledná data můžeme před vykreslením ještě různě formátovat. Například u sloupce published by se nám hodil pouze datum. K tomu slouží metoda setRenderer, která má jako parametr anonymní funkci s parametrem konkrétního řádku.\r\n\r\n/--php\r\n$this->addColumn(\'published\', \'Datum\', \'100px\')\r\n			->setRenderer(function($row){return date(\'j.n.Y\', strtotime($row[\'published\']));})\r\n\\--\r\nMůžeme vykreslit i html tagy pomocí [api:Nette\\Utils\\Html::el()]\r\nNapříklad odkaz na profil autora článku\r\n/--php\r\n	$this->addColumn(\'username\', \'Autor\', \'100px\')\r\n			->setRenderer(function($row) use ($presenter){return \\Nette\\Utils\\Html::el(\'a\')->setText($row[\'username\'])->href($presenter->link(\"user\", $row[\'user_id\']));});\r\n\\--\r\nFormátování buňky\r\n=============\r\nPokud chceme stylem zvýraznit buňku na základě její hodnoty, můžeme k tomu využít metodu setCellRenderer.\r\n/--php\r\n$this->addColumn(\'views\', \'Zobrazení\', \'100px\')\r\n	->setCellRenderer(function($row){return $row[\'views\'] > 80 ? \"background-color:#E4FFCC\" : NULL;});\r\n\\--\r\nŘádkové akce\r\n============\r\nPro přidání řádkové akce slouží metoda addButton. Pomocí třídy se nastaví ikonka a pro odkaz a potvrzující dialog slouží anonymní funkce.\r\n/--php\r\n$self = $this;\r\n\r\n$this->addButton(\"delete\", \"Smazat\")\r\n	->setClass(\"delete\")\r\n	->setLink(function($row) use ($self){return $self->link(\"delete!\", $row[\'id\']);})\r\n	->setConfirmationDialog(function($row){return \"Určitě chcete odstranit článek $row[title]?\";});\r\n\\--\r\nPokud bychom nechtěli na akci využít AJAX, například při odkazu na jiný Presenter, použijeme metodu setAjax(FALSE)\r\n/--php\r\n$this->addButton(\"edit\", \"Editovat\")\r\n	->setClass(\"edit\")\r\n	->setLink(function($row) use ($presenter){return $presenter->link(\"article:edit\", $row[\'id\']);})\r\n	->setAjax(FALSE);\r\n\\--\r\nMůžeme vytvořit i akci, která bude mit jinou funkci na základě hodnoty řádku. Například akce pro publikování/odpublikování článku.\r\n/--php\r\n$this->addButton(\"publish\")\r\n	->setLabel(function ($row) use ($self) {return $row[\'status\'] == \"Publikované\" ? \"Odpublikovat\" : \"Publikovat\";})\r\n	->setLink(function($row) use ($self){return $row[\'status\'] == \"Publikované\" ? $self->link(\"unpublish!\", $row[\'id\']) : $self->link(\"publish!\", $row[\'id\']);})\r\n	->setClass(function ($row) use ($self) {return $row[\'status\'] == \"Publikované\" ? \"unpublish\" : \"publish\";});\r\n\\--\r\n\r\nUkázka [zde | www.grid.jakubholub.cz/buttons]\r\nHromadné akce\r\n=============\r\nPro přidání hromadné akce použijeme metodu addAction. V metodě setCallback je parametr id, který obsahuje pole s hodnotami id vybraných sloupců.\r\n/--php\r\n$this->addAction(\"publish\",\"Publikovat\")\r\n	->setCallback(function($id) use ($self){return $self->handlePublish($id);});\r\n\\--\r\nPro hromadnou akci můžeme také nastavit potvrzovací dialog.\r\n/--php\r\n$this->addAction(\"delete\",\"Smazat\")\r\n	->setCallback(function($id) use ($self){return $self->handleDelete($id);})\r\n	->setConfirmationDialog(\"Určitě chcete smazat všechny vybrané članky?\");\r\n\\--\r\n\r\nUkázka [zde | www.grid.jakubholub.cz/actions]\r\nŘádková editace\r\n==============\r\nPro aktivaci řádkové editace je třeba přidat řádkovou akci za pomocí předdefinované konstanty.\r\n/--php\r\n$this->addButton(Grid::ROW_FORM, \"Rychlá editace\")\r\n	->setClass(\"fast-edit\");\r\n\\--\r\nNyní je již aktivní tlačítko pro editaci, ale ještě nejsou žádné sloupce označené jako editovatelné. K tomu slouží metody, které se zapisují ke sloupci.\r\n/--php\r\n//textEditable slouží pro textové i číselné hodnoty\r\nsetTextEditable();\r\nsetDateEditable();\r\n//v případě selectEditable se grid automaticky pokusí nastavit defaultní hodnotu na základě pole $values a tím umožní editaci připojených tabulek\r\nsetSelectEditable(array $values, $prompt)\r\nsetBooleanEditable();\r\n\r\n//pro formátování hodnoty do editovatelného formuláře\r\nsetFormRenderer($callback);\r\n\\--\r\n\r\nPro získání a uložení hodnot musíme nastavit callback v metodě configure pro formulář.\r\n/--php\r\n$this->setRowFormCallback(function($values){\r\n	//db update, flash message, ..\r\n);\r\n\\--\r\n\r\nUkázka [zde | www.grid.jakubholub.cz/editable]\r\nFiltrování dat\r\n=============\r\nPro filtrování využíváme následujících 5 metod u sloupce.\r\n/--php\r\nsetTextFilter();\r\nsetNumericFilter();\r\nsetDateFilter();\r\nsetSelectFilter(array $values, $prompt);\r\nsetBooleanFilter();\r\n\\--\r\n\r\nPokud je v Gridu potřeba sloupec z připojené tabulky a chceme v daném sloupci filtrovat záznamy, použije se metoda u sloupce setTableName(„table.column“).\r\n\r\n/--php\r\n$dataSource = new NDataSource($articles->select(\"article.title, user.username AS username\"));\r\n...\r\n$this->addColumn(\"username\", \"Uživatel\")\r\n        ->setTableName(\"user.username\")\r\n        ->setTextFilter();\r\n\\--\r\n\r\nFiltrování **textu**\r\n|* text | obsahuje \"text\"\r\n|* text% | začíná na \"text\"\r\n|* %text | končí na \"text\"\r\n\r\nFiltrování **čísel** a **datumu**\r\n|* 1 | přesně 1\r\n|* >1 | větší než 1\r\n|* >=1 | větší nebo rovno 1\r\n|* <1 | menší než 1\r\n|* <=1 | menší nebo rovno 1\r\n|* <>1 | rozdílný od 1\r\n\r\nUkázka [zde | www.grid.jakubholub.cz/filter]\r\nAutocomplete\r\n============\r\nAutocomplete se nastavuje pro filtr a může být použit pouze s textovým filtrem. Nastavuje se až po filtru. Jediný parametr je počet vyhledávaných záznamů.\r\n/--php\r\n$this->addColumn(\'column\', \'Column\')\r\n	->setTextFilter()\r\n	->setAutocomplete($numOfResults);\r\n\\--\r\n\r\nUkázka [zde | www.grid.jakubholub.cz/autocomplete]\r\nSubGridy\r\n============\r\nKaždý Grid může mit více SubGridů. Každý SubGrid může mít další SubGridy. Přidání SubGridy je velice jednoduché, viz kód:\r\n/--php\r\n$this->addSubGrid(\"comments\", \"Zobrazit komentáře k článku\")\r\n	->setGrid(new CommentGridByArticleId($presenter->context->database->table(\'comment\'), $this->activeSubGridId))\r\n	->settings(function($grid){\r\n		$grid->setWidth(\"800px\");\r\n		$grid[\'columns-title\']->setWidth(\"400px\");\r\n	})\r\n	->setCellStyle(\"background-color:#f6f6f6; padding:20px;\");\r\n\\--\r\nV metodě setGrid předáme jinou instanci Gridu, předem vytvořenou, například pro komentáře ke konkrétnímu článku. Druhý parametr Gridu je $this->activeSubGridId, což je id řádku, pro který chceme komentáře zobrazit a automaticky je při otevření SubGridu nastaven. V Gridu CommentGridByArticleId budeme omezovat výběr podmínkou na konkrétní id. Pokud chceme uplatnit nějaké nastavení po inicializaci SubGridu, můžeme použít metodu settings. Pro styl buňky subGridu použijeme metodu setCellStyle.\r\n\r\nTakto by mohl vypadat jednoduchý Grid CommentGridByArticleId\r\n/--php\r\nuse \\NiftyGrid\\Grid;\r\n\r\nclass CommentGridByArticleId extends Grid\r\n{\r\n	protected $comments;\r\n\r\n	protected $article_id;\r\n\r\n	public function __construct($comments, $article_id)\r\n	{\r\n		parent::__construct();\r\n		$this->comments = $comments;\r\n		$this->article_id = $article_id;\r\n	}\r\n\r\n	protected function configure($presenter)\r\n	{\r\n		$source = new \\NiftyGrid\\NDataSource($this->comments->select(\'comment.id, title, user.username\')->where(\'article_id = ?\', $this->article_id));\r\n\r\n		$this->setDataSource($source);\r\n\r\n		$this->addColumn(\"title\", \"Titulek\");\r\n		$this->addColumn(\"username\", \"Autor\");\r\n	}\r\n\r\n}\r\n\\--\r\n',	'texy',	'http://www.grid.jakubholub.cz/subgrid',	'2012-09-25 00:45:25',	'BSD-3-Clause',	399,	459,	NULL,	NULL),
(6,	'WebLoader',	'jan-marek',	'web-loader',	4,	'https://github.com/janmarek/WebLoader',	'github',	'Tool for loading or deploying CSS and JS files into web pages',	'Instalace\r\n=========\r\n\r\nZkopírujte obsah složky `WebLoader` do své aplikace.\r\n\r\nWebLoader je možné také získat přes balíčkovací systém \"Composer\":http://packagist.org/packages/JanMarek/WebLoader.\r\n\r\nPříklad použití\r\n===============\r\n\r\nCSS\r\n---\r\n\r\nTovárnička komponenty v presenteru:\r\n\r\n/--code php\r\n\r\npublic function createComponentCss()\r\n{\r\n	// připravíme seznam souborů\r\n	// FileCollection v konstruktoru může dostat výchozí adresář, pak není potřeba psát absolutní cesty\r\n	$files = new \\WebLoader\\FileCollection(WWW_DIR . \'/css\');\r\n	$files->addFiles(array(\r\n		\'style.css\',\r\n		WWW_DIR . \'/colorbox/colorbox.css\'\r\n	));\r\n\r\n	// kompilátoru seznam předáme a určíme adresář, kam má kompilovat\r\n	$compiler = \\WebLoader\\Compiler::createCssCompiler($files, WWW_DIR . \'/webtemp\');\r\n\r\n	// nette komponenta pro výpis <link>ů přijímá kompilátor a cestu k adresáři na webu\r\n	return new \\WebLoader\\Nette\\CssLoader($compiler, $this->template->basePath . \'/webtemp\');\r\n}\r\n\\--\r\n\r\nPoužití v šabloně:\r\n/--code html\r\n{control css}\r\n{* nebo pro vygenerování jiných souborů *}\r\n{control css \'base.css\', \'layout.css\', \'subfolder/text.css\'}\r\n\\--\r\n\r\nJavaScript\r\n----------\r\n\r\nTovárnička komponenty v presenteru:\r\n\r\n/--code php\r\npublic function createComponentJs()\r\n{\r\n	$files = new \\WebLoader\\FileCollection(WWW_DIR . \'/js\');\r\n	// můžeme načíst i externí js\r\n	$files->addRemoteFile(\'http://ajax.googleapis.com/ajax/libs/jquery/1.7/jquery.min.js\');\r\n	$files->addFiles(array(\'netteForms.js\', \'colorbox.js\', \'web.js\'));\r\n\r\n	$compiler = \\WebLoader\\Compiler::createJsCompiler($files, WWW_DIR . \'/webtemp\');\r\n\r\n	return new \\WebLoader\\Nette\\JavaScriptLoader($compiler, $this->template->basePath . \'/webtemp\');\r\n}\r\n\\--\r\n\r\nPoužití v šabloně:\r\n/--code html\r\n{control js}\r\n\\--\r\n\r\nHromadné přidání souborů\r\n------------------------\r\n\r\nWebLoader lze kombinovat s utilitou [Nette\\Utils\\Finder | doc:finder].\r\n\r\n/--code php\r\n$files->addFiles(Finder::findFiles(\'*.css\')->from(APP_DIR . \'/templates\'));\r\n\\--\r\n\r\nJiné chování při production a development módu\r\n------------------------------------------\r\n\r\n/--code php\r\n// při development módu vypne spojování souborů\r\n$dev = $presenter->context->parameters[\'developmentMode\'];\r\n$compiler->setJoinFiles($dev);\r\n\r\nif ($dev) {\r\n	$compiler->addFilter(callback(\'packJs\'));\r\n}\r\n\\--\r\n\r\nFiltry\r\n======\r\n\r\nPodobu vygenerovaného kódu lze ovlivnit použitím filtrů. Mohou to být libovolné callbacky, tedy anonymní funkce či objekty s magickou metodou __invoke. Filtry přijímají v parametrech řetězec `$code` a instanci Compileru. Registrují se pomocí metody `addFilter` na objektu `$compiler`.\r\n\r\nPokud je pro filtr důležité, jaký soubor zrovna zpracovává, lze jej registrovat pomocí metody `$compiler->addFileFilter()` a v tom případě dostane ve třetím parametru absolutní cestu k souboru. V prvním parametru je pak obsažen pouze kód právě zpracovávaného souboru.\r\n\r\nMinimalizovaný JavaScript pomocí filtrů a třídy [JavaScriptPacker | http://dean.edwards.name/download/#packer]\r\n------------------------------------\r\n\r\n/--code php\r\n$compiler->addFilter(function ($code) {\r\n	$packer = new JavaScriptPacker($code, \"None\");\r\n	return $packer->pack();\r\n});\r\n\\--\r\n\r\nChování JavaScriptPackeru je ale dost \"agresivní\"((nesnese vynechání středníku v JS)), takže bych pro minifikaci doporučil spíše knihovny \"jsmin\":https://github.com/rgrove/jsmin-php/ a \"cssmin\":http://code.google.com/p/cssmin/.\r\n\r\nLessFilter\r\n----------\r\n\r\nPokud chceme při psaní CSS využít preprocesoru Less, je nejdříve potřeba stáhnout knihovnu \"LessPHP\":https://github.com/leafo/lessphp/. Filtr LessFilter pak nechá zpracovat lessem všechny soubory s příponou less.\r\n\r\n/--php\r\n// filtr přidáme jednoduše\r\n$compiler->addFileFilter(new \\Webloader\\Filter\\LessFilter());\r\n\\--\r\n\r\nCSS s proměnnými pomocí filtru VariablesFilter\r\n----------------\r\n\r\n/--code php\r\n// proměnné filtru je možné nastavit buď přímo v konstruktoru\r\n$filter = new WebLoader\\Filter\\VariablesFilter(array(\r\n	\"cervena\" => \"red\",\r\n	\"zelena\" => \"green\",\r\n));\r\n\r\n// nebo pomocí magického __set\r\n$filter->modra = \"blue\";\r\n\r\n// podobu proměnné v css souboru lze nastavit také\r\n// $filter->setDelimiter(\"{\", \"}\");\r\n// výchozí hodnoty jsou {{$ a }}\r\n\r\n// nastavení filtru\r\n$compiler->addFilter($filter);\r\n\\--\r\n\r\nCSS soubor:\r\n\r\n/--code css\r\nbody {background: {{$cervena}}}\r\nh1 {color: {{$modra}}}\r\np {color: {{$zelena}}}\r\n\\--\r\n\r\nVýstup:\r\n/--code css\r\nbody {background: red}\r\nh1 {color: blue}\r\np {color: green}\r\n\\--\r\n\r\nV JavaScriptu lze proměnné výhodně použít pro nastavování URL adres na různé presentery či signály.\r\n\r\nPoužití pro deployment script\r\n=============================\r\n\r\nInstance třídy Compiler lze zaregistrovat do aplikačního kontejneru jako služby. Tyto služby si můžeme poté vytáhnout někde v deployment scriptu a naložit s ním zhruba takto:\r\n\r\n/--php\r\n$context->jsloader->generate(FALSE);\r\n$context->cssloader->generate(FALSE);\r\n\\--\r\n\r\n/--comment\r\n\r\nAPI\r\n===\r\n\r\nSoučástí WebLoaderu jsou čtyři třídy: `CssLoader`, `JavaScriptLoader`, jejich abstraktní předek `WebLoader` a filtr `VariablesFilter`.\r\n\r\nWebLoader\r\n---------\r\n\r\n**Veřejné proměnné**\r\n\r\n|---------------------------------\r\n| název | význam | výchozí hodnota\r\n|---------------------------------\r\n| sourcePath | zdrojová složka, cesta na disku | |\r\n| sourceUri | zdrojová složka, adresa | |\r\n| tempPath | cílová složka, cesta na disku | |\r\n| tempUri | cílová složka, adresa | |\r\n| joinFiles | spojovat soubory do jednoho | `true`\r\n| generatedFileNamePrefix | prefix názvu generovaných souborů | `\"generated-\"`\r\n| filters | Pole filtrů. Filtry jsou libovolné callbacky, které berou jako parametr řetězec a vracejí také řetězec. | `array()`\r\n\r\n**Veřejné metody**\r\n\r\n|-------------------------------\r\n| název | význam | parametry | vrací\r\n|-------------------------------\r\n| getElement | *abstraktní* | `string` | `Nette\\Web\\Html` nebo `string`\r\n| render | renderuje komponentu | volitelně soubory k vygenerování | |\r\n| getFiles | získat pole soubor | | `array(string)`\r\n| addFile | přidat soubor pokud existuje | `string` | |\r\n| addFiles | přidat více souborů | `array(string)` | |\r\n| removeFile | odebrat soubor | `string` | |\r\n| removeFiles | odebrat více souborů | `array(string)` | |\r\n| clear | odebrat všechny soubory | |\r\n| getLastModified | datum změny nejnovějšího souboru | volitelně pole souborů, jinak zjištuje hodnotu z aktuálně přidaných souborů | `timestamp`\r\n| getGeneratedFilename | Název vygenerovaného souboru ze souborů. Hodnota závisí na názvu a času změny souborů. | volitelně pole souborů, jinak zjištuje hodnotu z aktuálně přidaných souborů | `string`\r\n| getContent | obsah vygenerovaného souboru | volitelně pole souborů, jinak zjištuje hodnotu z aktuálně přidaných souborů | `string`\r\n\r\nCssLoader\r\n---------\r\n\r\n**Veřejné proměnné**\r\n\r\n|---------------------------------\r\n| název | význam | výchozí hodnota\r\n|---------------------------------\r\n| media | obsah atributu media tagu link | |\r\n| absolutizeUrls | přepisovat hodnoty `url(...)` v CSS souborech na jejich absolutní formu | `true`\r\n\r\n**Veřejné metody**\r\n\r\n|-------------------------------\r\n| název | význam | parametry | vrací\r\n|-------------------------------\r\n| getElement | generuje tag link | hodnota atributu href | `Nette\\Web\\Html`\r\n| getGeneratedFilename | přepsaná metoda, přidává koncovku css | volitelně pole souborů, jinak zjištuje hodnotu z aktuálně přidaných souborů | `string`\r\n\r\nJavaScriptLoader\r\n----------------\r\n\r\n**Veřejné metody**\r\n\r\n|-------------------------------\r\n| název | význam | parametry | vrací\r\n|-------------------------------\r\n| getElement | generuje tag script | hodnota atributu src | `Nette\\Web\\Html`\r\n| getGeneratedFilename | přepsaná metoda, přidává koncovku js | volitelně pole souborů, jinak zjištuje hodnotu z aktuálně přidaných souborů | `string`\r\n\r\nVariablesFilter\r\n---------------\r\n\r\n**Veřejné metody**\r\n\r\n|-------------------------------\r\n| název | význam | parametry | vrací\r\n|-------------------------------\r\n| *konstruktor* | volitelně přijme asociativní pole `array(\'promenna\' => \'hodnota\')` | asociativní pole | |\r\n| setVariable | nastaví proměnnou | `string` název, `string` hodnota | |\r\n| setDelimiter | Nastaví tvar proměnných na *první parametr + název proměnné + druhý parametr*. Výchozí hodnoty jsou `{{$` a `}}` | `string` začátek proměnné, `string` ukončení proměnné | |\r\n| apply | provede náhradu proměnných | `string` | `string`\r\n\r\n\r\n\\--\r\n',	'texy',	NULL,	'2012-09-25 00:47:43',	'MIT',	2968,	2960,	NULL,	NULL),
(7,	'ComponentTreePanel',	'jasir',	'component-tree-panel',	6,	'https://github.com/jasir/ComponentTreePanel',	'github',	'Debug panel for Nette Framework. Displays presenter and components hiearchy.',	'Co to umí\r\n===========\r\n\r\n- zobrazuje kompletní hiearchii komponentního stromu\r\n- zobrazuje dumpy jednotlivých komponent - **NEW!**\r\n- zobrazuje obsah values pro formuláře - **NEW!**\r\n- zobrazuje parametry (persistentní i normální) presenteru i komponent a také ***v jaké komponentě jsou persistentní parametry definovány***\r\n- zobrazuje vybrané metody prezenterů a komponent (i s částí zdrojového kódu)\r\n- metody jsou rozčleněny do skupin (lifecycle, actions, createComponent...)\r\n- zabrazuje obarvené zdrojové kódy\r\n- prakticky na všech relevantních místech umožňuje kliknutím otevřít zdroják v editoru\r\n- je implementováno kešování (výkon)\r\n\r\nAktivace\r\n========\r\nPro aktivaci panelu (přidání na **Debug Bar**) do *bootstrap.php* přidáme řádek\r\n/--php\r\nExtras\\Debug\\ComponentTreePanel::register();\r\n\\--\r\n\r\nPokud chcte vypnout dumpování komponent do stromu:\r\n\r\n/--php\r\nExtras\\Debug\\ComponentTreePanel::$dumps = FALSE;\r\n\\--\r\n\r\nUkázky\r\n======\r\n\r\nStrom komponent:\r\n\r\n[* http://files.nette.org/1451/collapsed.png *]\r\n\r\nPo kliknutí na prezenter, metody, parametry:\r\n\r\n[* http://files.nette.org/1451/presenter.png *]\r\n\r\nPerzistentní parametry:\r\n\r\n[* http://files.nette.org/1451/parameters.png *]\r\n\r\nKomponenta:\r\n\r\n[* http://files.nette.org/1451/ct-component.png *]\r\n\r\n\r\nHistorie\r\n========\r\n| 16.9.2011 | - z hlavního stromu odebrány formulářové prvky, nyní se zobrazují jako detail formuláře\r\n|            | - formuláře zobrazují obsah values\r\n|            | - u formulářů se nezobrazují metody ani zdrojový kód\r\n| 22.6.2011 | - přehlednější strom, minimalističtější, odstraněno $fullTree option\r\n| 21.4.2011 | - změny namespaces namespace Nette 2.0 - přidáno ComponentTreePanel::$cache pro vypnutí cachování\r\n| 22.4.2011 | - přidána možnost dumpování obsahu komponent\r\n| 23.4.2011 | - přidáno zobrazování parametrů\r\n| 26.4.2012 | - označení persistentních component\r\n',	'texy',	NULL,	'2012-09-25 00:52:34',	'MIT',	4573,	4607,	NULL,	NULL),
(8,	'GpsPicker',	'vojtech-dobes',	'nette-forms-gpspicker',	3,	'https://github.com/vojtech-dobes/nette-forms-gpspicker',	'github',	'Google Maps based picker of coordinates for Nette Framework.',	'### Instalace\r\n\r\n1. Získáme zdrojový kód z Githubu nebo přes Composer.\r\n2. Obsah složky `src` přidáme mezi knihovny.\r\n3. V `bootstrap.php` provedeme registraci extenze `VojtechDobes\\NetteForms\\GpsPickerExtension` do `$configurator->onCompile[]`.\r\n4. Do `app/@layout.latte` přilinkujeme jQuery, \"Google Maps API v3\":https://developers.google.com/maps/documentation/javascript/tutorial a `client/nette.gpsPicker.js`.\r\n\r\n/--js\r\n{\r\n	\"require\": {\r\n		\"vojtech-dobes/nette-forms-gpspicker\": \"1.0.x\"\r\n	}\r\n}\r\n\\--\r\n\r\n/--php\r\n$configurator->onCompile[] = function ($configurator, $compiler) {\r\n	$compiler->addExtension(\'gpspicker\', new VojtechDobes\\NetteForms\\GpsPickerExtension);\r\n};\r\n\\--\r\n\r\n### Použití\r\n\r\n/--php\r\n$form->addGpsPicker(\'coords\', \'Coordinates:\');\r\n\\--\r\n\r\nMůžeme přidat nastavení:\r\n\r\n/--php\r\n$form->addGpsPicker(\'coords\', \'Coordinates:\', array(\r\n	\'type\' => VojtechDobes\\NetteForms\\GpsPicker::TYPE_SATELLITE,\r\n	\'zoom\' => 1,\r\n	\'size\' => array(\r\n		\'x\' => 411,\r\n		\'y\' => 376,\r\n	),\r\n));\r\n\\--\r\n\r\nPokud bychom chtěli formulář renderovat manuálně, můžeme vynechat popisek:\r\n\r\n/--php\r\n$form->addGpsPicker(\'coords\', array(\r\n	\'type\' => ...\r\n	...\r\n));\r\n\\--\r\n\r\nVrácená hodnota prvku je instancí `GpsPoint` s proměnnými `lat` a `lng`. `GpsPoint` dědí od [api:Nette\\Object].\r\n\r\n/--php\r\n$lat = $form->values->coords->lat;\r\n$lng = $form->values->coords->lng;\r\n\\--\r\n\r\n## Validace\r\n\r\n/--php\r\nuse VojtechDobes\\NetteForms\\GpsPicker as Gps;\r\n\\--\r\n\r\nPrvek podporuje následující validační pravidla:\r\n\r\n/--php\r\n$form->addGpsPicker(\'coords\')\r\n    ->addRule(Gps::MIN_LAT, \'Minimální zeměpisná šířka musí být %f.\', 20)\r\n    ->addRule(Gps::MIN_LNG, \'Minimální zeměpisná výška musí být %f.\', 40)\r\n    ->addRule(Gps::MAX_LAT, \'Maximální zeměpisná šířka musí být %f.\', 20)\r\n    ->addRule(Gps::MAX_LNG, \'Maximální zeměpisná výška musí být %f.\', 40)\r\n    ->addRule(Gps::MIN_DISTANCE_FROM, \'Minimální vzdálenost od Prahy musí být %d metrů.\', array(15000, array(\r\n        \'lat\' => 50.083,\r\n        \'lng\' => 14.423,\r\n    )));\r\n    ->addRule(Gps::MAX_DISTANCE_FROM, \'Maximální vzdálenost od Prahy musí být %d metrů.\', array(100000, array(\r\n        \'lat\' => 50.083,\r\n        \'lng\' => 14.423,\r\n    )));\r\n\\--\r\n\r\nPrvní čtyři pravidla jsou validována i Javascriptem.\r\n\r\n## Manuální renderování\r\n\r\nPokud má uživatel vypnutý Javascript nebo je offline, doplněk mu nabídne několik formulářových polí, takže může souřadnice vyplnit ručně. Tato jednotlivá pole lze jednoduše renderovat manuálně s pomocí zvláštního párového makra `{gpspicker}`.\r\n\r\n/--html\r\n{form formName}\r\n    ...\r\n\r\n    {gpspicker coords}\r\n        {label lat}Latitude:{/label} {input lat}\r\n        {label lng}Longitude:{/label} {input lng}\r\n    {/gpspicker}\r\n{/form}\r\n\\--\r\n\r\n## Vyhledávání podle adresy\r\n\r\nVe výchozím stavu je GpsPicker vybaven políčkem pro nastavení lokace dle adresy, fungující na bázi Google Maps Places Autocomplete.\r\n\r\nPolíčko je stejně jako ostatní prvky možné vykreslovat ručně, a to pomocí klíče `search`:\r\n\r\n/--html\r\n{gpspicker coords}\r\n    {label search /} {input search}\r\n{/gpspicker}\r\n\\--\r\n\r\nVyhledávání lze vypínat/zapínat párem metod `enableSearch`/`disableSearch`:\r\n\r\n/--php\r\n$form->addGpsPicker(\'coords\', \'Coordinates:\')\r\n    ->disableSearch();\r\n\\--\r\n\r\nNebo v konstruktoru:\r\n\r\n/--php\r\n$form->addGpsPicker(\'coords\', \'Coordinates:\', array(\r\n    \'search\' => FALSE,\r\n));\r\n\\--\r\n\r\n\r\n',	'texy',	NULL,	'2012-09-25 00:57:16',	'BSD-3-Clause',	1421,	1393,	NULL,	NULL);
